import React from "react";
import useScript from "./hooks/useScript";

const Aladin = () => {
  React.useEffect(() => {
    useScript("https://code.jquery.com/jquery-1.12.1.min.js");
    useScript(
      "https://aladin.u-strasbg.fr/AladinLite/api/v2/latest/aladin.min.js"
    );
    let aladin = A.aladin("#aladin-lite-div", {
      survey: "P/DSS2/color",
      fov: 60,
    });
    aladin.setFov(1);
  }, []);

  return (
    <div id="aladin-lite-div" style={{ width: "400px", height: "400px" }} />
  );
};

export default Aladin;
